import { useEffect, useState } from "react";
const Home = () => {
  const [tourists, setTourists] = useState(null);
  useEffect(() => {
    const fetchTourists = async () => {
      const response = await fetch("http://localhost:4000/api/tourists");
      // array of tourists
      const json = await response.json();

      if (response.ok) {
        setTourists(json);
      }
    };

    fetchTourists();
  }, []);
  return (
    <div className="Home">
      <h2>Home</h2>
    </div>
  );
};

export default Home;
